import React, { Component } from 'react';

export default class AddProduct extends Component {
  render() {
    return (
      <div>
        <section className="container">
          <section className="sign-up">
            <form action="#">
              <p>Name</p>
              <input id="name" type="text" placeholder="enter product name"/>

              <p>Price</p>
              <input id="price" type="text" placeholder="enter product price"/>

              <p>Description</p>
              <input id="description" placeholder="enter product description"/>

              <input id="add-button" type="button" className="button" value="Add"/>
            </form>
          </section>
        </section>
      </div>
    );
  }
}
